import React from 'react';
import { Parallax, Background } from 'react-parallax';
import img from './photo.jpg';

const Temp = () => (
    <div className='container'>
    <div id='inside'>
        <div className='layer' dataDepth="0">

            <h1 style={{position:'relative', top:'100px'}} >parallax 2</h1> 
        </div>
    </div>

</div>    
)

export default Temp;
